USE teamz;
DROP TABLE course;
CREATE TABLE course
(
   id varchar(255) PRIMARY KEY NOT NULL,
   act varchar(255),
   attribute varchar(255),
   cap varchar(255),
   cmp varchar(255),
   cred varchar(255),
   crn varchar(255),
   crse varchar(255),
   date varchar(255),
   days varchar(255),
   dept varchar(255),
   instructor varchar(255),
   location varchar(255),
   part_of_term varchar(255),
   rem varchar(255),
   sec varchar(255),
   selection varchar(255),
   semester varchar(255),
   subj varchar(255),
   time varchar(255),
   title varchar(255)
)
;
CREATE UNIQUE INDEX PRIMARY ON course(id)
;


